function RotMat = fRotMatMult(dRotMat,RotMat0)RotMat.xx = dRotMat.xx.*RotMat0.xx + dRotMat.xy.*RotMat0.yx + dRotMat.xz.*RotMat0.zx;RotMat.xy = dRotMat.xx.*RotMat0.xy + dRotMat.xy.*RotMat0.yy + dRotMat.xz.*RotMat0.zy;RotMat.xz = dRotMat.xx.*RotMat0.xz + dRotMat.xy.*RotMat0.yz + dRotMat.xz.*RotMat0.zz;RotMat.yx = dRotMat.yx.*RotMat0.xx + dRotMat.yy.*RotMat0.yx + dRotMat.yz.*RotMat0.zx;RotMat.yy = dRotMat.yx.*RotMat0.xy + dRotMat.yy.*RotMat0.yy + dRotMat.yz.*RotMat0.zy;RotMat.yz = dRotMat.yx.*RotMat0.xz + dRotMat.yy.*RotMat0.yz + dRotMat.yz.*RotMat0.zz;RotMat.zx = dRotMat.zx.*RotMat0.xx + dRotMat.zy.*RotMat0.yx + dRotMat.zz.*RotMat0.zx;RotMat.zy = dRotMat.zx.*RotMat0.xy + dRotMat.zy.*RotMat0.yy + dRotMat.zz.*RotMat0.zy;RotMat.zz = dRotMat.zx.*RotMat0.xz + dRotMat.zy.*RotMat0.yz + dRotMat.zz.*RotMat0.zz;